  \"2016-05-31T01:07:36.012565\",\n\t\"name\": \"afsc-race-gap-prescott-central-gulf-of-alaska-multibeam-survey-h11118\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"We assembled 1.75 million National Ocean
  Service (NOS) bathymetric soundings from 225 lead-line and single-beam echosounder
  hydrographic surveys conducted from 1901 to 1999 in the central Gulf of Alaska.
  These bathymetry data are available from the National Geophysical Data Center (NGDC:
  http://www.ngdc.noaa.gov), which archives and distributes data that were originally
  collected by the NOS and others. While various bathymetry data have been downloaded
  previously from NGDC, compiled, and used for a variety of projects, our effort differed
  in that we compared and corrected the digital bathymetry by studying the original
  analog source documents - digital versions of the original survey maps, called smooth
  sheets. There were several areas where these older surveys were superseded by more
  recent, higher quality multibeam surveys, mostly from the NOS (n=106). Three of
  these were unprocessed NOS multibeam surveys in the Sitka area, which we edited
  and processed into final bathymetric surfaces. We reduced the resolution of these
  multibeam surveys to 100 m, since some may have sub-meter resolution and many exceed
  a million soundings, and added them to our bathymetry compilation. nIn Sitka Sound
  survey H11118 was missing. Processing and adding its bathymetric data to our compilation
  filled in a substantial gap in Sitka area, between Kruzof, Krestof, and Middle islands.\",\n\t\"license_title\":
